import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles(() => ({
    root: {},
    form: {
        display: "flex",
        flexDirection: "column",
        alignItems: "center",
        justifyContent: "center",
        textAlign: "center",
        width: "100%",
    },
}));
export default useStyles;
